import cycle from './cycle.jpg'

export default class App extends Component { 
    render() { 
        let style = true;
        return (
            <div>
               <button type="button" className="btn btn-danger">Normal Button</button>
               <button type="button" className="btn btn-success">Normal Button</button>
            </div>
            
            
        );
               
                     
    }
}
